import React from "react";
import { connect } from "react-redux";
import { getBookingList } from "../../../redux/action/admin/booking/action"
import { Link } from "react-router-dom";

class BookingList extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            bookings : []
        }       
    }

    componentDidMount() {
        this.props.getBooking().then(() => {
            this.setState({
                bookings : this.props.bookings
            });
        });
    }

    render(){

        return (
            <div>
                <h3>Manage Bookings</h3>
                <div >
                    {
                        (this.state.bookings.length > 0) ? (
                            <table className="table">
                                <thead>
                                    <tr>
                                    <th style={{width:'2%'}} >#</th>
                                    <th  style={{width:'%'}}>Name</th>
                                    <th  style={{width:'2%'}}>Vehicle</th>
                                    <th  style={{width:'2%'}}>From Date</th>
                                    <th  style={{width:'2%'}}>To Date</th>
                                    <th  style={{width:'20%'}}> Message</th>
                                    <th  style={{width:'2%'}} >Status</th>
                                    <th  style={{width:'2%'}} >Posting Date</th>
                                    <th   style={{width:'2%'}}>Action</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {

                                        this.state.bookings.map( el => (
                                            <tr key={el.id}>
                                                <td>1</td>
                                                <td>{el.FullName}</td>
                                                <td>{el.VehiclesTitle}</td>
                                                <td>{el.FromDate}</td>
                                                <td>{el.ToDate}</td>
                                                <td>{el.message}</td>
                                                <td>{

                                                 (() => {

                                                     console.log("status",el)

                                                     if(el.Status == 0) {
                                                        return <span>Not Confirmed yet</span>
                                                     }else if(el.Status == 1) {
                                                        return <span>Confirmed</span>
                                                     }else if(el.Status == 2) {
                                                        return <span>Cancelled</span>
                                                     }
                                                 })()
                                                }</td>

                                                <td>{el.PostingDate}</td>
                                                <td>
                                                    <Link to={`/admin/brand/manage/edit/${el.id}`}>update</Link>
                                                    <a className="ml-2" href="#" onClick={
                                                        () => this.removeBrand(el.id)
                                                        }>Delete</a>
                                                </td>
                                            </tr>
                                        ))
                                    }


                                </tbody>
                            </table>

                        ) : (
                            <h3>Loading</h3>
                        )
                    }

                </div>
            </div>
        )

    }
}

const mapStateToProps = (state) => {
    const booking = state.booking;

    return {
        bookings : booking.booking_list
    }
}

const dispatchStateToProps = (dispatch) => {
    return {
        getBooking : () => dispatch(getBookingList())
    }
}

export default connect(mapStateToProps,dispatchStateToProps)(BookingList);
